import{_ as o,o as a,c as t,ag as r}from"./chunks/framework.BcJof20X.js";const u=JSON.parse('{"title":"Winget Explorer","description":"","frontmatter":{},"headers":[],"relativePath":"views/winget.md","filePath":"views/winget.md","lastUpdated":1769391860000}'),n={name:"views/winget.md"};function i(l,e,s,c,g,p){return a(),t("div",null,[...e[0]||(e[0]=[r('<h1 id="winget-explorer" tabindex="-1">Winget Explorer <a class="header-anchor" href="#winget-explorer" aria-label="Permalink to &quot;Winget Explorer&quot;">​</a></h1><p>The <strong>Winget Explorer</strong> provides a graphical interface for the Windows Package Manager (winget), allowing you to search, install, and manage applications from the official Microsoft repository.</p><h2 id="purpose" tabindex="-1">Purpose <a class="header-anchor" href="#purpose" aria-label="Permalink to &quot;Purpose&quot;">​</a></h2><p>Winget Explorer simplifies software discovery and deployment by wrapping the command-line <code>winget</code> tool in a modern UI. It allows IT professionals to quickly find package IDs, download installers for offline use, or install software directly.</p><h2 id="interface-overview" tabindex="-1">Interface Overview <a class="header-anchor" href="#interface-overview" aria-label="Permalink to &quot;Interface Overview&quot;">​</a></h2><h3 id="_1-search-bar" tabindex="-1">1. Search Bar <a class="header-anchor" href="#_1-search-bar" aria-label="Permalink to &quot;1. Search Bar&quot;">​</a></h3><ul><li><strong>Input</strong>: Enter the name, publisher, or tag of an application.</li><li><strong>Search Button</strong>: Executing <code>winget search</code>.</li><li><strong>Results</strong>: Displays a list of matching packages with: <ul><li><strong>Name</strong>: Application name.</li><li><strong>ID</strong>: The unique Package ID (e.g., <code>Google.Chrome</code>).</li><li><strong>Version</strong>: Latest available version.</li><li><strong>Source</strong>: Repository source (usually <code>winget</code> or <code>msstore</code>).</li></ul></li></ul><h3 id="_2-package-actions" tabindex="-1">2. Package Actions <a class="header-anchor" href="#_2-package-actions" aria-label="Permalink to &quot;2. Package Actions&quot;">​</a></h3><p>Clicking on a search result (or using the dots menu) offers:</p><ul><li><strong>Install</strong>: Installs the application on your local machine using <code>winget install</code>.</li><li><strong>Download Installer</strong>: Downloads the raw installer file (<code>.exe</code> / <code>.msi</code>) to your Downloads folder. <ul><li><em>Useful for packaging apps that don&#39;t have direct download links.</em></li></ul></li><li><strong>Show Details</strong>: Displays full metadata (Description, Homepage, License, Hash).</li><li><strong>Copy ID</strong>: Copies the Package ID to clipboard (e.g., for use in scripts).</li></ul><h3 id="_3-bulk-operations-import-export" tabindex="-1">3. Bulk Operations (Import/Export) <a class="header-anchor" href="#_3-bulk-operations-import-export" aria-label="Permalink to &quot;3. Bulk Operations (Import/Export)&quot;">​</a></h3><ul><li><strong>Import (package.json / .xml)</strong>: Allows you to install a list of applications from a WinGet export file.</li><li><strong>Export Installed</strong>: Generates a list of all apps installed on your current machine.</li></ul><h2 id="integration" tabindex="-1">Integration <a class="header-anchor" href="#integration" aria-label="Permalink to &quot;Integration&quot;">​</a></h2><ul><li><strong>Analyzer Integration</strong>: Downloaded installers can be sent directly to the <strong>Analyzer</strong> tab for inspection.</li><li><strong>Intune Integration</strong>: You can generate Intune apps directly from Winget packages (via the &#39;Download &amp; Package&#39; workflow).</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><ul><li><strong>&quot;Winget not found&quot;</strong>: Ensure App Installer is updated in the Microsoft Store.</li><li><strong>Search failed</strong>: Check your internet connection. Some corporate firewalls block the Winget CDN.</li></ul>',16)])])}const h=o(n,[["render",i]]);export{u as __pageData,h as default};
